//
// Knots between the nodes.
// Nodes: dimensions and transformations:
//   x1:
//     transformation: log(x1_val)
//     subdivisions: 1
//       x1_min=1.58387e-003
//         nodes: 200
//       x1_max=771.691
//   x2:
//     transformation: none
//     subdivisions: 1
//       x2_min=250.
//         nodes: 100
//       x2_max=1300.
//
